import React, { useState } from "react";
import { Link as ScrollLink } from "react-scroll";
import { useNavigate, useLocation } from "react-router-dom";

const Navbar = () => {
  const [isMobileMenuOpen, setIsMobileMenuOpen] = useState(false);
  const navigate = useNavigate();
  const location = useLocation();

  const handleLogout = (e) => {
    e.stopPropagation(); // Prevent any parent event handlers from triggering
    console.log("Logout triggered");
    const confirmLogout = window.confirm("Are you sure you want to log out?");
    if (confirmLogout) {
      localStorage.removeItem("isLoggedIn");
      navigate("/"); // Redirect to login or homepage after logout
    }
  };

  const handleLogoClick = () => {
    navigate("/"); // Redirect to the homepage
  };

  const isHomepage = location.pathname === "/";

  return (
    <nav className="backdrop-blur-lg bg-opacity-20 bg-black fixed top-0 w-full p-4 flex justify-between items-center shadow-lg z-50">
      {/* Logo */}
      <h1
        onClick={handleLogoClick}
        className="text-xl sm:text-2xl md:text-3xl font-bold text-cyan-400 cursor-pointer"
      >
        QuickRent
      </h1>

      {/* Desktop Navbar */}
      <ul className="hidden md:flex space-x-6 text-white text-sm sm:text-base md:text-lg lg:text-xl">
        {isHomepage ? (
          <>
            <li>
              <ScrollLink
                to="features"
                smooth={true}
                duration={500}
                className="cursor-pointer hover:text-cyan-400 transition"
              >
                Features
              </ScrollLink>
            </li>
            <li>
              <ScrollLink
                to="gadgets"
                smooth={true}
                duration={500}
                className="cursor-pointer hover:text-cyan-400 transition"
              >
                Gadgets
              </ScrollLink>
            </li>
            <li>
              <ScrollLink
                to="contact"
                smooth={true}
                duration={500}
                className="cursor-pointer hover:text-cyan-400 transition"
              >
                Contact
              </ScrollLink>
            </li>
          </>
        ) : (
          <>
            <li>
              <button
                onClick={(e) => {
                  e.stopPropagation();
                  navigate("/#features");
                }}
                className="cursor-pointer hover:text-cyan-400 transition"
              >
                Features
              </button>
            </li>
            <li>
              <button
                onClick={(e) => {
                  e.stopPropagation();
                  navigate("/#gadgets");
                }}
                className="cursor-pointer hover:text-cyan-400 transition"
              >
                Gadgets
              </button>
            </li>
            <li>
              <button
                onClick={(e) => {
                  e.stopPropagation();
                  navigate("/#contact");
                }}
                className="cursor-pointer hover:text-cyan-400 transition"
              >
                Contact
              </button>
            </li>
          </>
        )}
      </ul>

      {/* Mobile Hamburger Menu */}
      <div className="md:hidden">
        <button
          className="text-cyan-400 text-2xl"
          onClick={(e) => {
            e.stopPropagation();
            setIsMobileMenuOpen(!isMobileMenuOpen);
          }}
        >
          ☰
        </button>
      </div>

      {/* Mobile Menu */}
      {isMobileMenuOpen && (
        <ul className="absolute top-16 left-0 w-full bg-black text-white flex flex-col items-center space-y-4 py-4 shadow-lg text-base sm:text-lg">
          {isHomepage ? (
            <>
              <li>
                <ScrollLink
                  to="features"
                  smooth={true}
                  duration={500}
                  className="cursor-pointer hover:text-cyan-400 transition"
                  onClick={() => setIsMobileMenuOpen(false)}
                >
                  Features
                </ScrollLink>
              </li>
              <li>
                <ScrollLink
                  to="gadgets"
                  smooth={true}
                  duration={500}
                  className="cursor-pointer hover:text-cyan-400 transition"
                  onClick={() => setIsMobileMenuOpen(false)}
                >
                  Gadgets
                </ScrollLink>
              </li>
              <li>
                <ScrollLink
                  to="contact"
                  smooth={true}
                  duration={500}
                  className="cursor-pointer hover:text-cyan-400 transition"
                  onClick={() => setIsMobileMenuOpen(false)}
                >
                  Contact
                </ScrollLink>
              </li>
            </>
          ) : (
            <>
              <li>
                <button
                  onClick={(e) => {
                    e.stopPropagation();
                    navigate("/#features");
                    setIsMobileMenuOpen(false);
                  }}
                  className="cursor-pointer hover:text-cyan-400 transition"
                >
                  Features
                </button>
              </li>
              <li>
                <button
                  onClick={(e) => {
                    e.stopPropagation();
                    navigate("/#gadgets");
                    setIsMobileMenuOpen(false);
                  }}
                  className="cursor-pointer hover:text-cyan-400 transition"
                >
                  Gadgets
                </button>
              </li>
              <li>
                <button
                  onClick={(e) => {
                    e.stopPropagation();
                    navigate("/#contact");
                    setIsMobileMenuOpen(false);
                  }}
                  className="cursor-pointer hover:text-cyan-400 transition"
                >
                  Contact
                </button>
              </li>
            </>
          )}
          <li>
            <button
              onClick={handleLogout}
              className="bg-cyan-400 text-black px-6 py-2 rounded-md hover:bg-cyan-500 transition"
            >
              Logout
            </button>
          </li>
        </ul>
      )}

      {/* Desktop Logout Button */}
      <button
        onClick={handleLogout}
        className="hidden md:block bg-cyan-400 text-black px-6 py-2 rounded-md hover:bg-cyan-500 transition text-sm sm:text-base md:text-lg"
      >
        Logout
      </button>
    </nav>
  );
};

export default Navbar;
